import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App() {
  return (
    <div>
      <Header />
      {notes.map(emojiTerm => (
        <Note
          key={emojiTerm.id}
          title={emojiTerm.title}
          content={emojiTerm.content}
        />
      ))}
      <Footer />
    </div>
  );
}

export default App;
